const expect = require('chai').expect;
const request = require('supertest');

const app = require('../../app');

var validToken = "";

describe('Login for image api test', () => {
    it('Login for image api test', (done) =>{
        request(app).post('/user/UserLogin')
        .send({
                "username": "test",
                "password": "123456"
        })
        .then((res) =>{
            const body = res.body;
            expect(body).to.contain.property('token');
            expect(body).to.contain.property('username');
            validToken = body.token;
            done();
        })
    });

    it('Upload an image under test user', (done) =>{
        request(app).post('/image/Upload')
        .set({
            authorization: validToken
        })
        .send({
            "desc": "Test upload @ " + new Date().toISOString(),
            "data": "",
        })
        .then((res) =>{
            const body = res.body;
            expect(body).to.contain.property('success');
            expect(body.success).equal(true);
            done();
        })
    });

    it('List images 1st page and last page pagination data', (done) => {
        var currentPage = 1;
        var recordPerPage = 5;
        var totalRecordCount;
        
        request(app).post('/user/ListImage')
        .set({
            authorization: validToken
        })
        .send({
            "filterUsername": "test",
            "sortKey": "timestamp",
            "sortDir": "ASC",
            "pagination": recordPerPage,
            "page": currentPage
        })
        .then((res) =>{
            const body = res.body;
            expect(body).to.contain.property('success');
            expect(body.success).equal(true);
            expect(body).to.contain.property('data');
            expect(body.data).to.contain.property('success');
            expect(body.data).to.contain.property('data');
            expect(body.data).to.contain.property('totalDataCount');
            totalRecordCount = body.data.totalDataCount;
            if (currentPage * recordPerPage > totalRecordCount)
            {
                // This is a last page data
                // Data length should be reminder of the recrodPerPage
                expect(body.data.data.length).equal(body.data.totalDataCount % recordPerPage);
                console.log("I Passed remainder test");
            }
            else
            {
                // This a full loaded page
                expect(body.data.data.length).equal(recordPerPage);
                console.log("I Passed full page test");
            }
        });

        while (currentPage * recordPerPage < totalRecordCount)
        {
            currentPage += 1;
        }
        
        // Testing last page data
        request(app).post('/user/ListImage')
        .set({
            authorization: validToken
        })
        .send({
            "filterUsername": "test",
            "sortKey": "timestamp",
            "sortDir": "ASC",
            "pagination": recordPerPage,
            "page": currentPage
        })
        .then((res) =>{
            const body = res.body;
            expect(body).to.contain.property('success');
            expect(body.success).equal(true);
            expect(body).to.contain.property('data');
            expect(body.data).to.contain.property('success');
            expect(body.data).to.contain.property('data');
            expect(body.data).to.contain.property('totalDataCount');
            totalRecordCount = body.data.totalDataCount;
            if (currentPage * recordPerPage > totalRecordCount)
            {
                // This is a last page data
                // Data length should be reminder of the recrodPerPage
                expect(body.data.data.length).equal(body.data.totalDataCount % recordPerPage);
                console.log("I Passed remainder test");
            }
            else
            {
                // This a full loaded page
                expect(body.data.data.length).equal(recordPerPage);
                console.log("I Passed full page test");
            }
        });

        done();
    });
});